import React from "react";

export default function Card(props){
    return (
        <div className="video">

             <div className="video-link">
                <p><a href={props.videoId}/></p>
                <img src={props.channelThumbnail}/>
             </div>


             <div className="video-details"></div>

        </div>
    )
}
